package leetcode392

import "testing"

var data = []struct {
	in1 string
	in2 string
	out bool
}{
	{"axc", "ahbgdc", false},
	{"abc", "ahbgdc", true},
	{"b", "c", false},
	{"leeeeetcode", "", false},
}

func TestAll(t *testing.T) {
	for _, d := range data {
		r := isSubsequence(d.in1, d.in2)
		if r != d.out {
			t.Error(d.out, r)
		}
	}
}
